import React from "react";
import Header from "../components/Header";

function NoMatch() {
    return (
        <div>
            <Header>
                <h1>404 Not Found</h1>
                <h1>
                    <span role="img" aria-label="Face With Rolling Eyes Emoji">

                    </span>
                </h1>
            </Header>
        </div>
    );
}

export default NoMatch;
